import React from "react";

const PendingPartner = ({ partner, onApprove }) => {
  if (!partner) return null; // Prevent crash

  return (
    <div 
      style={{
        padding: "16px",
        marginBottom: "12px",
        border: "1px solid #ccc",
        borderRadius: "10px",
        background: "#fafafa"
      }}
    >
      <h3 style={{ marginBottom: "8px" }}>
        {partner.name || "Unnamed Partner"}
      </h3>

      <p><strong>Email:</strong> {partner.email || "N/A"}</p>
      <p><strong>Phone:</strong> {partner.phone || "N/A"}</p>
      <p><strong>City:</strong> {partner.city || "N/A"}</p>

      <p>
        <strong>Categories Applied:</strong>{" "}
        {partner.categories?.length > 0
          ? partner.categories.join(", ")
          : "No categories selected"}
      </p>

      {/* Status messages */}
      <div style={{ color: "red", marginTop: "10px" }}>
        {partner.kycSubmitted === false && <p>❌ KYC Not Submitted</p>}
        {partner.kycVerified === false && <p>❌ KYC Not Verified</p>}
        {partner.registrationPaid === false && <p>❌ Registration Payment Pending</p>}
      </div>

      <button
        onClick={() => onApprove(partner.id)}
        style={{
          marginTop: "10px",
          padding: "10px 14px",
          background: "#4CAF50",
          color: "#fff",
          border: "none",
          borderRadius: "6px",
          cursor: "pointer"
        }}
      >
        Approve Partner
      </button>
    </div>
  );
};

export default PendingPartner;
